import { Injectable } from '@angular/core';
import { AlertComponent, EAlertStatus } from './alert.component';
import { MatSnackBar, MatSnackBarConfig } from '@angular/material/snack-bar';

@Injectable()
export class AlertService {

    constructor(private _matSnackBar: MatSnackBar) {
    }

    public get matSnackbar() {
        return this._matSnackBar;
    }

    public alert(message: string, status: EAlertStatus, config: MatSnackBarConfig = {}) {
        config.duration = 5000;
        config.verticalPosition = 'bottom';
        config.panelClass = 'alert';
        config.data = {message, status};
        return this.matSnackbar.openFromComponent(AlertComponent, config);
    }

    public alertSuccess(message: string, config: MatSnackBarConfig = {}) {
        return this.alert(message, EAlertStatus.success, config);
    }

    public alertWarning(message: string, config: MatSnackBarConfig = {}) {
        return this.alert(message, EAlertStatus.warning, config);
    }

    public alertError(message: string, config: MatSnackBarConfig = {}) {
        return this.alert(message, EAlertStatus.error, config);
    }

}

import { Injectable } from '@angular/core';
import { EndpointsParameter } from '@parameters/endpoints.parameter';
import { GenericService } from '@clients/generic/generic.service';
import { take } from 'rxjs/operators';
import { IAuthCodeRequest, IAuthRequest, IAuthResponse, IAuthRestorePasswordRequest } from '@interfaces/auth.interface';
import { Observable } from 'rxjs';
import { HttpHeaders, HttpParams } from '@angular/common/http';
import { EAuthCredentials } from '@parameters/auth.parameters';
import { EHttpHeaderContentTypes, EHttpHeaders } from '@parameters/http-header.parameter';


@Injectable()
export class AuthClientService {

    constructor(
        private genericService: GenericService,
    ) {
    }

    signIn(iAuthRequest: IAuthRequest): Observable<IAuthResponse> {
        const endpoint = `${EndpointsParameter.AUTH_TOKEN}`;

        iAuthRequest.grant_type = EAuthCredentials.grant_type;
        const body = new HttpParams({fromObject: {...iAuthRequest}}).toString();

        const header = new HttpHeaders({
            [EHttpHeaders.contentType]: EHttpHeaderContentTypes.xWwwFormUrlencoded,
            [EHttpHeaders.authorization]: `Basic ${btoa(EAuthCredentials.username + ':' + EAuthCredentials.password)}`
        });

        return this.genericService.genericPost<IAuthResponse>(endpoint, body, null, header)
            .pipe(take(1));
    }

    sendPasswordCode(username: string): Observable<boolean> {
        const endpoint = `${EndpointsParameter.AUTH_SEND_CODE}`;
        const httpParams = new HttpParams()
            .set('email', String(username));
        return this.genericService.genericGet<boolean>(endpoint, httpParams)
            .pipe(take(1));
    }

    validPasswordCode(iAuthCodeRequest: IAuthCodeRequest): Observable<boolean> {
        const endpoint = `${EndpointsParameter.AUTH_VALID_CODE}`;
        return this.genericService.genericPost<boolean>(endpoint, iAuthCodeRequest)
            .pipe(take(1));
    }

    resetPassword(iAuthRestorePasswordRequest: IAuthRestorePasswordRequest): Observable<boolean> {
        const endpoint = `${EndpointsParameter.AUTH_RESTORE_PASSWORD}`;
        return this.genericService.genericPost<boolean>(endpoint, iAuthRestorePasswordRequest)
            .pipe(take(1));
    }

}

import { Injectable } from '@angular/core';
import { AuthClientService } from '@clients/auth/auth-client.service';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';
import { IAuthResponse, IAuthRestorePasswordRequest } from '@interfaces/auth.interface';
import { TokenStoreService } from '@stores/token-store.service';


@Injectable()
export class AuthImplementService {


    constructor(
        private authClient: AuthClientService,
        private tokenStore: TokenStoreService
    ) {
    }


    signIn(username: string, password: string): Observable<IAuthResponse> {
        return this.authClient.signIn({username, password})
            .pipe(
                map((iAuthResponse: IAuthResponse) => {
                    this.tokenStore.accessToken = iAuthResponse.access_token;
                    return iAuthResponse;
                })
            );
    }

    sendPasswordCode(username: string): Observable<boolean> {
        return this.authClient.sendPasswordCode(username);
    }

    validPasswordCode(email: string, code: string): Observable<boolean> {
        return this.authClient.validPasswordCode({email, code});
    }

    resetPassword(iAuthRestorePasswordRequest: IAuthRestorePasswordRequest) {
        return this.authClient.resetPassword(iAuthRestorePasswordRequest);
    }

}

