import { Injectable } from '@angular/core';
import { fromEvent } from 'rxjs';
import { filter } from 'rxjs/operators';

@Injectable()
export class StorageClientService {

    private STORAGE_NAME_EVENT = 'storage';

    constructor() {
    }

    public get storage(): Storage {
        return localStorage;
    }

    public get storage$() {
        return fromEvent<StorageEvent>(window, this.STORAGE_NAME_EVENT)
            .pipe(
                filter(event => event && event.storageArea === this.storage));
    }

    public cleanStorage() {
        const {storage} = this;
        return storage.clear();
    }

    public getStorageItem(key: string) {
        const {storage} = this;
        return storage.getItem(key);
    }

    public setStorageItem(key: string, value: string) {
        const {storage} = this;
        return storage.setItem(key, value);
    }

    public removeStorageItem(key: string) {
        const {storage} = this;
        return storage.removeItem(key);
    }
}

import { Injectable } from '@angular/core';
import { StorageClientService } from '@clients/storage/storage-client.service';
import { BehaviorSubject, Observable } from 'rxjs';

@Injectable()
export class TokenStoreService {
    private readonly STORAGE_SESSION_TOKEN = 'access-token';
    private _accessToken: string;

    private accessTokenSubject = new BehaviorSubject<string>(null);

    constructor(private storage: StorageClientService) {
        this._accessToken = this.storedAccessToken;
        this.accessTokenSubject.next(this._accessToken);
    }

    private set storedAccessToken(token: string) {
        const {storage, STORAGE_SESSION_TOKEN} = this;
        storage.setStorageItem(STORAGE_SESSION_TOKEN, token);
    }

    private get storedAccessToken(): string {
        const {storage, STORAGE_SESSION_TOKEN} = this;
        return storage.getStorageItem(STORAGE_SESSION_TOKEN);
    }

    private removeStoredAccessToken(): void {
        const {storage, STORAGE_SESSION_TOKEN} = this;
        storage.removeStorageItem(STORAGE_SESSION_TOKEN);
    }

    get accessToken$(): Observable<string> {
        return this.accessTokenSubject.asObservable();
    }

    get accessToken(): string {
        return this._accessToken;
    }

    set accessToken(token: string) {
        this._accessToken = token;
        this.accessTokenSubject.next(token);
        this.storedAccessToken = token;
    }

    removeAccessToken() {
        this._accessToken = null;
        this.accessTokenSubject.next(null);
        this.removeStoredAccessToken();
    }

}

import { Injectable, OnDestroy } from '@angular/core';
import { FormBuilder, FormControl, FormGroup } from '@angular/forms';
import { PasswordControl } from '../controls/password.control';
import { ConfirmPasswordControl } from '../controls/confirm-password.control';
import { Subscription } from 'rxjs';

@Injectable()
export class UpdatePasswordForm implements OnDestroy {
    private readonly form: FormGroup;

    private _passwordControl: FormControl = new PasswordControl();
    private _confirmPasswordControl: FormControl = new ConfirmPasswordControl('password');

    private passwordSubscription: Subscription;

    constructor(
        private _formBuilder: FormBuilder
    ) {
        this.form = this._formBuilder.group({
            password: this._passwordControl,
            confirmPassword: this._confirmPasswordControl,
        });

        this.passwordSubscription = this.passwordControl.valueChanges.subscribe(() => {
            this.confirmPasswordControl.updateValueAndValidity({onlySelf: false, emitEvent: true});
        });
    }

    get form$(): FormGroup {
        return this.form;
    }

    public get passwordControl(): PasswordControl {
        return this.form$.get('password') as PasswordControl;
    }

    public get confirmPasswordControl(): ConfirmPasswordControl {
        return this.form$.get('confirmPassword') as ConfirmPasswordControl;
    }


    resetForm(): void {
        this.passwordControl.patchValue('');
        this.confirmPasswordControl.patchValue('');
    }

    ngOnDestroy(): void {
        this.resetForm();
        this.passwordSubscription.unsubscribe();
    }
}

import { Injectable } from '@angular/core';
import { Role } from '@models/auth/role.model';
import { User } from '@models/auth/user.model';
import { TokenStoreService } from '@stores/token-store.service';
import { JwtDecodeToken } from '@helpers/jwt-decode.helper';
import { IUser } from '@interfaces/user.interface';
import { BehaviorSubject, Observable } from 'rxjs';
import { CONCAT_PATH } from '@parameters/concat-router-path.parameter';
import { Router } from '@angular/router';

@Injectable()
export class UserStoreService {

    private user: User;
    private userSubject = new BehaviorSubject<User>(null);

    constructor(
        private tokenStore: TokenStoreService,
        private router: Router,
    ) {
        this.tokenStore.accessToken$.subscribe((accessToken) => {
            if (accessToken) {
                this.userFromToken = accessToken;
            } else {
                this.user = null;
            }
        });
    }

    set userFromToken(accessToken: string) {
        const tokenUser = JwtDecodeToken<IUser>(accessToken);
        this.user = new User(tokenUser);
        this.userSubject.next(this.user);
    }

    authenticated(): boolean {
        return !!this.user;
    }

    hasRole(role: Role): boolean {
        return this.authenticated() && this.user.role === role;
    }

    get currentUser(): User {
        return this.user;
    }

    get currentUser$(): Observable<User> {
        return this.userSubject.asObservable();
    }

    logout() {
        this.user = null;
        this.userSubject.next(null);
        this.tokenStore.removeAccessToken();
        this.router.navigate([CONCAT_PATH.login]);
    }
}

