    border: 1px solid $gray-1;
    box-sizing: border-box;
    border-radius: 8px;
  }

  .step-header {
    background-color: transparent;
    padding: 24px 24px 0;
    align-items: flex-start;

    &:hover {
      background-color: transparent;
    }

    &[aria-disabled=true] {
      .step-header-id {
        background-color: $gray-4;
      }

      .step-header-title {
        color: $gray-4;
      }
    }

    &.mat-expanded {
      .step-header-id {
        background-color: $primary;
      }

      .step-header-title {
        color: $primary;
      }
    }

    .step-header-content {
      width: 100%;
      justify-content: space-between;
      @extend .d-flex-vertical-center
    }

    .step-header-title-container {
      @extend .d-flex-vertical-center
    }

    .step-header-id {
      border-radius: 4px;
      padding: 6px 8px;
      width: 24px;
      height: 24px;
      color: $white;
      background-color: $gray-6;
      margin-right: 18px;
      @extend .text-caption
    }

    .step-header-title {
      @extend .text-tag
    }

    .step-header-description-container {
      justify-content: flex-end;
      margin-right: 0;
      max-width: 250px;
      @extend .d-flex-vertical-center;

      &-readonly {
        pointer-events: none;
      }
    }

    .step-header-description {
      color: $dark-primary;
      margin-right: 8px;
      @extend .text-button
    }

    .step-header-description-icon {
      color: $dark-primary;
    }
  }


  ::ng-deep {
    .mat-expansion-panel-body {
      padding: 0 24px 24px;
    }
  }


  .step-body {
    border-top: 1px solid $gray-1;

    .steps-body-content {
      min-height: 70px;
    }

    .step-body-actions {
      border-top: 1px solid $gray-1;
      padding-top: 16px;
      @extend .d-flex-horizontal-end;
    }
  }
}

