@import "src/sass/variables/colors";
@import "src/sass/utilities/text";

.tooltip {
  display: unset;
}

::ng-deep .mat-tooltip.tooltip {
  display: inline-flex;
  position: relative;
  background: $black;
  border-radius: 4px;
  padding: 9px 8px;
  overflow: initial;
  color: $white;
  @extend .text-caption;

  &:after {
    content: "";
    height: 10px;
    width: 10px;
    position: absolute;
    background: $black;
    left: -5px;
    top: calc(50% - 5px);
    transform: rotate(45deg);
    transition: width 1s;
  }

  &.left,
  &.before{
    &:after {
      left: auto;
      right: -5px;
    }
  }

  &.below{
    &:after {
      left: calc(50% - 5px);
      top: -5px;
    }
  }

  &.above{
    &:after {
      left: calc(50% - 5px);
      bottom: -5px;
      top: auto;
    }
  }
}

